(window.webpackJsonp=window.webpackJsonp||[]).push([[449],{804:function(n,h,t){"use strict";t.r(h);var i=t(44),g=Object(i.a)({},(function(){var n=this,h=n.$createElement,t=n._self._c||h;return t("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[t("h1",{attrs:{id:"chuong-1381-cung-phung-tu-dat-giao-thu"}},[t("a",{staticClass:"header-anchor",attrs:{href:"#chuong-1381-cung-phung-tu-dat-giao-thu"}},[n._v("#")]),n._v(" Chương 1381: Cùng Phùng Tử Dật giao thủ")]),n._v(" "),t("hr"),n._v(" "),t("p",[n._v("Chương 1381: Cùng Phùng Tử Dật giao thủ"),t("br"),t("br"),n._v("Phùng Tử Dật, gặp qua một lần, lần này xông sơn môn hoàn toàn xứng đáng đệ nhất, liền Trương gia Trương Hủ đều bị ép xuống, không cách nào so sánh!"),t("br"),t("br"),n._v("Trước đó, chỉ biết là hắn là Danh Sư đường tổng bộ một vị thái thượng trưởng lão thân truyền, cũng không biết cụ thể thân phận, nghe Viên Hiểu đám người giới thiệu mới hiểu được, thật Dương Huyền học sinh... So với hắn cái này giả, chính bản nhiều!"),t("br"),t("br"),n._v("Chạy tới đợi bản thân vài ngày..."),t("br"),t("br"),n._v("Chẳng lẽ biết hắn vị này Lý Quỷ, ý định tự mình bắt quy án?"),t("br"),t("br"),n._v("“Hắn... Có hay không nói, tới tìm ta làm cái gì?”"),t("br"),t("br"),n._v("Cũng nhịn không được nữa, vội vàng hỏi."),t("br"),t("br"),n._v("Chỉ là một người ngược lại cũng thôi, ngộ nhỡ vị kia Dương sư cũng tới, thật chỉ có thể đường chạy."),t("br"),t("br"),n._v("Danh Sư đường tổng bộ, thần bí nhất, cường đại nhất thái thượng trưởng lão, thực lực mạnh mẽ, chỉ sợ đã vượt qua Thánh vực cửu trọng, căn bản không phải hắn có thể giấu diếm cùng chống lại."),t("br"),t("br"),n._v("“Chưa nói qua... Bất quá, hắn có vẻ rất có kiên nhẫn, liên tục đợi mấy ngày, biết rất rõ ràng ngươi không tại, nhưng cũng không đi...”"),t("br"),t("br"),n._v("Tôn Cường giải thích."),t("br"),t("br"),n._v("“Đây là ý định chặn ta...”"),t("br"),t("br"),n._v("Khóe miệng giật một cái."),t("br"),t("br"),n._v("Trước đó coi như giáo huấn cũng là Trương gia người, không có cái gì cùng xuất hiện, lại tại nơi này cam nguyện mấy người vài ngày, không phải “Dương Huyền thân truyền” tiết lộ thân phận, tuyệt không có khả năng làm như thế."),t("br"),t("br"),n._v("“Đúng rồi, Trương Cửu Tiêu cùng hắn cùng đi, cũng ở nơi đây đợi đã mấy ngày!”"),t("br"),t("br"),n._v("Đột nhiên nhớ tới, Tôn Cường nói tiếp."),t("br"),t("br"),n._v("“Cửu Tiêu? Hắn tới đây làm gì? Làm sao lại quen biết Phùng Tử Dật?”"),t("br"),t("br"),n._v("Trương Huyền ngẩn ngơ."),t("br"),t("br"),n._v("Trương Cửu Tiêu chỉ là miễn cưỡng trở thành Thánh tử điện học viên, khoảng cách lớp tinh anh còn có rất lớn một khoảng cách, làm sao lại quen biết vị này tinh anh đệ nhất?"),t("br"),t("br"),n._v("“Thiếu gia có muốn gặp bọn hắn hay không, nếu như không muốn gặp, ta liền nói ngươi bế quan...”"),t("br"),t("br"),n._v("Thấy hắn trên mặt một hồi âm một hồi quang, Tôn Cường hỏi."),t("br"),t("br"),n._v("“Gặp gỡ đi!”"),t("br"),t("br"),n._v("Là phúc thì không phải là họa, là họa thì tránh không khỏi, đều đã như vậy, cố ý che giấu cũng vô dụng, còn không bằng đi qua nhìn một chút, nhìn đối phương đến cùng muốn làm gì."),t("br"),t("br"),n._v("Lại nói, vừa về đến, liền đem thiên cơ sư, khải linh sư công hội biến thành phế tích, đối phương chỉ sợ đã chiếm được tin tức, cố ý tránh né... Cũng không phải tác phong của hắn."),t("br"),t("br"),n._v("Làm ra quyết định, không chần chờ nữa, thẳng tắp hướng viện lạc đại sảnh đi tới, tiến vào bên trong, quả nhiên thấy hai người ngồi tại quý vị khách quan bên trên, yên tĩnh chờ đợi."),t("br"),t("br"),n._v("Bên trong một cái, thấy hắn đi tới, vội vàng đứng lên, hai mắt sáng lên: “Trương sư, ngươi rốt cục trở về, thật để cho chúng ta đợi thật lâu, vị này Phùng sư huynh, chắc hẳn ngươi đã sớm biết, không nghĩ tới, thế mà cũng là Dương sư học sinh, cùng ngươi đồng căn đồng nguyên, mang tới cho các ngươi quen biết một chút...”"),t("br"),t("br"),n._v("Chính là Trương Cửu Tiêu."),t("br"),t("br"),n._v("“Dương sư học sinh?” Trương Huyền khóe miệng giật một cái, nhất thời hiểu được, hung tợn nhìn về phía trước mắt vị này, hận không thể một cái tát đem hắn đập chết."),t("br"),t("br"),n._v("Vừa rồi một mực đang nghĩ, đến cùng ai tiết lộ, bản thân là Dương Huyền học sinh tin tức, nằm mơ đều không có nghĩ đến, là cái này hai hàng..."),t("br"),t("br"),n._v("Trương Cửu Tiêu tại Thanh Nguyên thành liền quen biết, Ngô sư, Liêu đường chủ đám người cơ bản cũng biết hắn “Sư thừa” lai lịch, tùy tiện sau khi nghe ngóng, liền có thể biết..."),t("br"),t("br"),n._v("Rõ ràng “Dương Huyền” cũng không kỳ lạ."),t("br"),t("br"),n._v("Thế nhưng là... Biết liền biết tốt, cùng vị này Phùng Tử Dật đắc ý cái gì?"),t("br"),t("br"),n._v("Ngộ nhỡ, thật đem tin tức này truyền ra ngoài, để chân chính Dương sư biết... Chẳng phải xong?"),t("br"),t("br"),n._v("Xoa xoa mi tâm, Trương Huyền tràn đầy im lặng, nhưng lại không nói ra được, đành phải xấu hổ cười một tiếng: “Ngươi... Cũng sư thừa Dương sư?”"),t("br"),t("br"),n._v("Đứng dậy, Phùng Tử Dật không có trả lời hắn, mà là bàn tay duỗi ra, đi tới trong đại sảnh ở giữa: “Có dám cùng ta tỷ thí một trận?”"),t("br"),t("br"),n._v("“Tỷ thí!”"),t("br"),t("br"),n._v("Trương Huyền cau mày."),t("br"),t("br"),n._v("“Không sai!”"),t("br"),t("br"),n._v("Cũng không giải thích, Phùng Tử Dật khí tức trên thân, bỗng nhiên bay lên, lực lượng cường đại, lăn mình xao động, tựa hồ muốn không khí đập vụn."),t("br"),t("br"),n._v("“Đây là... Nhập Hư cảnh sơ kỳ?”"),t("br"),t("br"),n._v("Trương Huyền tràn đầy khó tin."),t("br"),t("br"),n._v("Lần trước nhìn thấy người này thời điểm, mới Lĩnh Vực cảnh hậu kỳ, ngắn ngủi hai mươi ngày không gặp, không chỉ đột phá, còn đạt đến Nhập Hư cảnh sơ kỳ, liên tục chợt tăng hai cái tiểu cấp bậc... Cũng quá kinh khủng đi!"),t("br"),t("br"),n._v("Thánh vực thất trọng Nhập Hư cảnh, mặc dù là Động Hư cảnh nhập môn, lại đủ để làm khó vô số thiên tài, để cho người ta chùn bước."),t("br"),t("br"),n._v("Trước mắt vị này, chỉ dùng hai mươi ngày, đã đột phá thành công, mấu chốt tuổi của hắn chỉ có hai mươi bốn, năm... Phần này thiên tư, so với hắn, đều không hề yếu, có phần thật là đáng sợ chút."),t("br"),t("br"),n._v("Thấy hắn chần chừ, Phùng Tử Dật cười lạnh: “Trong khoảng thời gian này, ta tiến bộ, có vẻ như ngươi đột phá cũng không chậm đi! Lần trước gặp mặt, chẳng qua Xuất Khiếu cảnh sơ kỳ, hiện tại đã đạt tới đỉnh phong! Xuất Khiếu cảnh sơ kỳ thời điểm, liền có thể vượt qua Trương Trác đám người, hiện tại khẳng định mạnh hơn! Thế nào, đối phó Trương gia người, dễ như trở bàn tay, đối ta cũng không dám?”"),t("br"),t("br"),n._v("Đối phương chấn kinh hắn tu vi bạo tăng, hắn cũng chấn kinh đối phương tốc độ tiến bộ."),t("br"),t("br"),n._v("Xông sơn môn thời điểm, chỉ có Nguyên Thần cảnh đỉnh phong, ngắn ngủi hai mươi ngày tới thời gian, đã tiến bộ một cái đại cấp bậc, biến thành Xuất Khiếu cảnh đỉnh phong, tốc độ so với hắn, nhanh hơn!"),t("br"),t("br"),n._v("Lại thêm thấy tận mắt đối phương vượt cấp năng lực chiến đấu, cũng nhịn không được nữa."),t("br"),t("br"),n._v("“Làm sao không dám...”"),t("br"),t("br"),n._v("Biết không tránh né được, Trương Huyền không tại nhiều nói, đi tới trong phòng ở giữa: “Xin mời!”"),t("br"),t("br"),n._v("Chỉ cần vị kia “Dương Huyền” không có xuất hiện, liền không sợ."),t("br"),t("br"),n._v("Đưa đầu một đao, rụt đầu cũng là một đao, đối phương muốn động thủ, vậy trước tiên chiến đấu một hồi lại nói."),t("br"),t("br"),n._v("Phần phật!"),t("br"),n._v(" Thấy hắn nghênh chiến, Phùng Tử Dật tiến về phía trước một bước, đã đi tới trước mặt, bàn tay nhẹ nhàng bóp một cái."),t("br"),t("br"),n._v("Rầm!"),t("br"),t("br"),n._v("Nhập Hư cảnh lĩnh vực lập tức đem gian phòng bao phủ, thần thức rơi vào trong đó, như là rơi vào một cái không gian khác, cũng lại không cảm thấy được, cùng thời khắc đó, bàn tay nghiền ép mà tới, hung mãnh lực lượng, giống như là cầm giữ bốn phía, để cho người ta như rơi chân không môi trường, hô hấp đều khó mà làm được."),t("br"),t("br"),n._v("“Thủ đoạn thật cao cường...”"),t("br"),t("br"),n._v("Trương Huyền híp mắt lại."),t("br"),t("br"),n._v("Hắn mặc dù không cùng Nhập Hư cảnh sơ kỳ người chiến đấu qua, nhưng cùng Bích Hồng Âm giao thủ qua, trước mắt vị này Phùng Tử Dật, cứ việc chỉ là sơ kỳ, sức chiến đấu lại cùng nàng vị này hậu kỳ, cũng không kém bao nhiêu!"),t("br"),t("br"),n._v("Bích Hồng Âm là thiên tài trong thiên tài, cứ việc so với Lạc Huyền Thanh đám người, còn hơi có không bằng, nhưng đã vượt qua rất nhiều thiên tài... Thực lực đối phương thấp nhiều như vậy, liền nắm giữ loại lực lượng này, thực sự thật là đáng sợ đi!"),t("br"),t("br"),n._v("“Phá!”"),t("br"),t("br"),n._v("Cảm nhận được ngực khó chịu, Trương Huyền biết chỉ cần trốn tránh, tất nhiên sẽ rơi vào càng thêm cục diện bị động, cũng không tránh né, cũng không phản kích, ngược lại gào lên một tiếng."),t("br"),t("br"),n._v("Thanh âm của hắn, mang theo ma âm mê hoặc, càng mang theo linh hồn công kích, chỉ một chút, giam cầm ở trước mắt lĩnh vực tựa như là nổ tung đồng dạng, xuất hiện từng đạo vết rách."),t("br"),t("br"),n._v("Học tập Bích Hồng Âm về ma âm thư tịch, đối ma âm lĩnh ngộ cùng hiểu, đã đạt đến bát tinh đỉnh phong, cứ việc nhận hạn chế tu vi, không phát huy ra thực lực mạnh nhất, chỉ khi nào sử dụng ra, cũng mười phần kinh khủng, không có siêu tuyệt tâm cảnh, căn bản không chịu nổi."),t("br"),t("br"),n._v("Tiếng quát đánh văng ra đối phương lĩnh vực, Trương Huyền ngón tay một điểm, một đạo kiếm khí thắng tới."),t("br"),t("br"),n._v("Thực lực của hắn so với đối phương thấp, biện pháp dự phòng không có bất kỳ cái gì ý nghĩa, trực tiếp thi triển ra sắc bén nhất công kích kiếm ý."),t("br"),t("br"),n._v("Xì xì xì xì...!"),t("br"),t("br"),n._v("Kiếm khí từ ngón tay dâng trào, trên không trung hình thành một đạo hải dương, mặc dù không phải Nhất Kiếm Phá Hải, nhiều như vậy kiếm ý liên hợp cùng một chỗ, cũng mang theo uy lực cường đại, tựa như gió lốc, nghênh đón mà tới!"),t("br"),t("br"),n._v("“Lợi hại...”"),t("br"),t("br"),n._v("Nhìn thấy hắn chiêu này, Phùng Tử Dật con mắt nhất thời sáng lên: “Dựa theo tình huống bình thường, không có đạt tới Nhập Hư cảnh, lĩnh vực chống lại không được Thánh vực thất trọng cường giả, một tiếng gào thét, dùng ma âm đánh gãy ta đối lĩnh vực khống chế, sau đó dùng kiếm khí tạo thành một cái thuộc về mình lĩnh vực, cùng ta đối kháng...”"),t("br"),t("br"),n._v("Lĩnh vực cường giả sở dĩ mạnh mẽ, là bởi vì tại đây cái phạm vi bên trong, nắm giữ đối thực lực tuyệt đối khống chế."),t("br"),t("br"),n._v("Đối phương chỉ là Xuất Khiếu cảnh đỉnh phong, không có lĩnh ngộ, tới chính diện mạnh mẽ chống đỡ, nhất định chịu thiệt, nhưng hắn lại chia ra lối tắt, lợi dụng kiếm khí lĩnh vực tới chiến đấu..."),t("br"),t("br"),n._v("Liền xem như hắn, cũng không ngờ tới!"),t("br"),t("br"),n._v("Có thể nói diệu quyết đỉnh phong."),t("br"),t("br"),n._v("Bành!"),t("br"),t("br"),n._v("Kiếm khí cùng bàn tay của hắn đối đầu, Phùng Tử Dật nhịn không được lui về sau hai bước."),t("br"),t("br"),n._v("Trương Huyền lui về phía sau càng nhiều, liên tục bảy, tám bước."),t("br"),t("br"),n._v("Một chiêu liền phân biệt ra được lực lượng mạnh yếu."),t("br"),t("br"),n._v("“So ta thấp hai cái đại cấp bậc, thế mà còn có thể chặn lại công kích của ta, ngươi đối với chiến đấu hiểu rất sâu, bất quá... Liền nhìn một chút có thể hay không đỡ được chiêu này!”"),t("br"),t("br"),n._v("Hai mắt sáng lên, Phùng Tử Dật bàn chân lần nữa đạp mạnh."),t("br"),t("br"),n._v("Hô!"),t("br"),t("br"),n._v("Thân ảnh hư ảo đồng dạng, thời gian nháy mắt bước ra hơn mười mét khoảng cách, đi tới trước mặt."),t("br"),t("br"),n._v("“Tốc độ thật nhanh...”"),t("br"),t("br"),n._v("Con ngươi co rụt lại."),t("br"),t("br"),n._v("Đối phương trong nháy mắt vọt tới tốc độ, thế mà không thể so với hắn Thiên đạo thân pháp chậm, thậm chí còn còn hơn!"),t("br"),t("br"),n._v("Lạc Huyền Thanh so với hắn tốc độ nhanh, là bởi vì tu vi cao, đối không gian lĩnh ngộ mạnh, trước mắt cái này thế mà cũng nhanh như vậy... Không hổ là Dương sư học sinh, Danh Sư đường tổng bộ tới thiên tài, thật là đáng sợ."),t("br"),t("br"),n._v("Biết tốc độ nhanh như vậy, né tránh không kịp, một khi bị đánh trúng, nhất định trọng thương, Trương Huyền cũng không mạnh mẽ chống đỡ, thân thể vội vàng co rụt lại, Thiên đạo thân pháp thi triển, nhanh chóng lùi về phía sau."),t("br"),t("br"),n._v("Xì xì xì!"),t("br"),t("br"),n._v("Hắn lui nhanh, đối phương tiến công nhanh hơn, Phùng Tử Dật duỗi ra ngón tay, tựa như bất cứ lúc nào cũng sẽ chút tại cổ họng của hắn bên trên, đem xuyên thủng."),t("br"),t("br"),n._v("Hô hô hô!"),t("br"),t("br"),n._v("Liên tục thi triển mấy loại thân pháp, đều như bóng với hình theo sát mà tới, Trương Huyền có chút nóng nảy."),t("br"),t("br"),n._v("“Tiếp tục như vậy, nhất định thua không thể nghi ngờ...”"),t("br"),t("br"),n._v("Một mực bị đối phương truy kích, hơn nữa chút tại trên cổ họng, cứ việc có thể lại trốn tránh mấy lần, có thể một mực tiếp tục như vậy, tương đương với bị đối phương nắm giữ tiết tấu, nhận thua chỉ là vấn đề thời gian."),t("br"),t("br"),n._v("“Đụng một cái!”"),t("br"),t("br"),n._v("Hít sâu một hơi, hai mắt đột nhiên trở nên ngưng trọng, lui về phía sau tránh né thân ảnh, bỗng nhiên ngừng lại, cổ trước mặt cơ bắp, đột nhiên co rụt lại."),t("br"),t("br"),n._v("Hô!"),t("br"),t("br"),n._v("Tay của đối phương chỉ điểm tại trên cổ họng, có điều, vẫn chưa giống tưởng tượng như thế, trực tiếp xuyên thủng, ngược lại giống như là đánh vào vũ khí phía trên, phát ra kim thiết giao kích thanh âm."),t("br"),t("br"),n._v("Thiên đạo kim thân!"),t("br"),t("br"),n._v("Thông qua học tập Viên Hiểu luyện thể công pháp, thân thể của hắn đã cứng rắn như là nửa bước thượng phẩm Thánh khí, đối phương chỉ cần không dùng binh khí, muốn đâm thủng, căn bản không có khả năng!"),t("br"),t("br"),n._v("“Cho ta nằm xuống!”"),t("br"),t("br"),n._v("Đối phương ngón tay bị ngăn trở, rõ ràng hiển lộ ra vẻ kinh ngạc, Trương Huyền biết tận dụng thời cơ, lông mày nâng lên, nắm đấm xiết chặt, trực tiếp đánh mà tới."),t("br"),t("br"),n._v("Một quyền này, không chỉ chân khí lực lượng, liền thân thể, hồn lực đều toàn bộ vận chuyển lên đến, còn chưa tới đến trước mặt, đối phương Nhập Hư cảnh lĩnh vực, liền vỡ vụn thành từng mảnh, giống như bọt biển."),t("br"),t("br"),n._v("“Ngươi... Cái này sao có thể?”"),t("br"),t("br"),n._v("Phùng Tử Dật không hề bận tâm biểu lộ, nhất thời biến đổi."),t("br"),t("br"),n._v("Người đăng: ThấtDạ"),t("br"),t("br"),t("br"),t("br")]),n._v(" "),t("hr"),n._v(" "),t("p",[t("a",{attrs:{href:"./chap-1389"}},[n._v("Chương trước")]),n._v("  |  "),t("a",{attrs:{href:"./chap-1391"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=g.exports}}]);